users.custom_css:
html, body {
    margin: 0;
    padding: 0;
    height: 100%;
    font-family: 'Minecraftia', monospace, 'Press Start 2P', monospace;
    background: url('https://static.wikia.nocookie.net/minecraft_gamepedia/images/f/f2/Dirt_background_BE1.png/') no-repeat center center fixed;
    background-size: cover;
    image-rendering: pixelated;
    color: #2E2B25;
    -webkit-font-smoothing: none;
    -moz-osx-font-smoothing: grayscale;
}


.profile-container, .profile-card, .wrapper {
	max-width: 1400px;
	margin: 48px auto;
	padding: 36px 40px;
	background: linear-gradient(180deg, #F0E4C0, #C7B482);
	border: 10px solid #3A2E14;
	border-radius: 0;
	box-shadow:
		10px 10px 0 rgba(0,0,0,0.5),
		inset 0 4px 0 #fffbe4;
	position: relative;
	z-index: 10;
	user-select: none;
}

.profile-header {
	display: flex;
	flex-direction: column;
	align-items: center;
	justify-content: center;
	padding: 32px 0 24px;
	border-bottom: 8px solid #3A2E14;
	background: linear-gradient(180deg, #D9B88F, #A67843);
	box-shadow: inset 0 3px 0 #fff3d1;
}

.profile-avatar, #avatar, .avatar img {
	width: 192px;
	height: 192px;
	border: 8px solid #3A2E14;
	background-color: #D9B88F;
	box-shadow: 6px 6px 0 rgba(0,0,0,0.5);
	object-fit: cover;
	image-rendering: pixelated;
}

.profile-name, h1.profile-name {
	color: #2E2B25;
	font-size: 2rem;
	text-shadow:
		2px 2px 0 #D9B88F,
		-2px -2px 0 #3A2E14;
	letter-spacing: 0.03em;
	margin: 16px 0 8px;
	font-weight: 900;
}

.handle, .tagline-badge, .profile-handle {
	color: #3A2E14;
	font-weight: 700;
	letter-spacing: 0.1em;
	font-size: 0.9rem;
	text-transform: uppercase;
	text-align: center;
	margin-bottom: 12px;
	text-shadow: 1px 1px 0 #F0E4C0;
}

.profile-bio,
.text-gray-900.text-sm.whitespace-pre-wrap.leading-relaxed.profile-bio {
	background: #F0E4C0;
	color: #2E2B25 !important;
	padding: 20px 24px;
	border: 10px solid #3A2E14;
	border-radius: 0;
	box-shadow:
		6px 6px 0 rgba(0,0,0,0.5),
		inset 0 3px 0 #fff7d9;
	white-space: pre-wrap;
	line-height: 1.4;
	font-weight: 600;
	letter-spacing: 0.04em;
	user-select: text;
}

.card-with-gradient {
	background: linear-gradient(180deg, #D9B88F, #A67843) !important;
	border: 10px solid #3A2E14 !important;
	color: #2E2B25 !important;
	box-shadow:
		8px 8px 0 rgba(0,0,0,0.5),
		inset 0 4px 0 #fffbe4 !important;
	border-radius: 0;
}

#activities-list {
	padding: 36px !important;
	background: linear-gradient(180deg, #F0E4C0, #C7B482);
	border: 10px solid #3A2E14;
	box-shadow: 8px 8px 0 rgba(0,0,0,0.5);
	border-radius: 0;
	margin-top: 20px;
}

h2, h3, h4, h5, h6 {
	color: #3A2E14 !important;
	text-shadow:
		2px 2px 0 #F0E4C0;
	margin: 0 0 8px 0;
	font-weight: 900;
	text-transform: uppercase;
	letter-spacing: 0.15em;
}

h2.text-2xl.font-bold.text-gray-800 {
	color: #3A2E14 !important;
	background: transparent !important;
	text-shadow:
		2px 2px 0 #F0E4C0;
	padding: 6px 0;
	text-align: center;
}

.card-with-gradient p,
.card-with-gradient span,
.card-with-gradient li,
.profile-card p,
.profile-card span,
.profile-card li {
	color: #2E2B25 !important;
}

h2::after {
	content: '';
	display: block;
	height: 2px;
	margin-top: 4px;
	background: linear-gradient(90deg, #5CA64C, #78A7FF);
	box-shadow: 0 0 6px #5CA64C, 0 0 12px #78A7FF;
}

.profile-stats, .stats {
	display: flex;
	gap: 16px;
	justify-content: center;
	margin-top: 24px;
	flex-wrap: wrap;
}

.profile-stat, .stat {
	background: #5CA64C;
	border: 10px solid #3A2E14;
	padding: 12px 20px;
	border-radius: 0;
	font-weight: 900;
	box-shadow: 8px 8px 0 rgba(0,0,0,0.5);
	color: #FDF6E3;
	text-transform: uppercase;
	letter-spacing: 0.1em;
	user-select: none;
}

.projects, .project-list {
	padding: 24px;
	border: 10px solid #3A2E14;
	background: linear-gradient(180deg, #F0E4C0, #C7B482);
	box-shadow: 8px 8px 0 rgba(0,0,0,0.5);
	border-radius: 0;
}

.project {
	display: flex;
	gap: 16px;
	align-items: center;
	padding: 12px;
	border-radius: 0;
	transition: transform 0.12s linear;
	cursor: pointer;
}

.project:hover {
	transform: translateX(10px);
	box-shadow: 12px 12px 0 rgba(0,0,0,0.5);
	background: linear-gradient(90deg, rgba(255,255,255,0.06), rgba(0,0,0,0.06));
}

.proj-thumb, .project-icon {
	width: 72px;
	height: 72px;
	border-radius: 0;
	background: #D9B88F;
	border: 10px solid #3A2E14;
	display: flex;
	align-items: center;
	justify-content: center;
	font-family: monospace;
	font-weight: 900;
	color: #5CA64C;
	box-shadow: 8px 8px 0 rgba(0,0,0,0.5);
	image-rendering: pixelated;
}

.socials {
	display: flex;
	gap: 14px;
	justify-content: center;
	margin-top: 20px;
}

.socials a {
	display: inline-flex;
	align-items: center;
	justify-content: center;
	padding: 12px 18px;
	border: 10px solid #3A2E14;
	background: #F0E4C0;
	color: #2E2B25;
	text-decoration: none;
	border-radius: 0;
	box-shadow: 8px 8px 0 rgba(0,0,0,0.5);
	font-weight: 700;
	text-transform: uppercase;
	letter-spacing: 0.1em;
	user-select: none;
}

.text-gray-900, .text-gray-900.text-sm.whitespace-pre-wrap.leading-relaxed.profile-bio {
	color: #2E2B25 !important;
	background: transparent !important;
}

@media (max-width: 980px) {
	.profile-container, .profile-card, .wrapper {
		padding: 24px;
		margin: 24px;
	}
	.profile-avatar, #avatar {
		width: 140px;
		height: 140px;
	}
	.proj-thumb, .project-icon {
		width: 56px;
		height: 56px;
	}
}
